ale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1394886","type":"CustomJS"},{"attributes":{"toolbar":{"id":"1394934"}},"id":"1394935","type":"ToolbarBox"},{"attributes":{},"id":"1394823","type":"UnionRenderers"},{"attributes":{"data":{"Close":{"__ndarray__":"KVyPwvXoUUDNzMzMzGxRQGZmZmZmtlFAw/UoXI+yUUAAAAAAANBRQB+F61G4zlFA7FG4HoWrUUBI4XoUrodRQOxRuB6FK1JAhetRuB5lU0A9CtejcD1TQHE9Ctej4FJASOF6FK6XUkAUrkfheoRSQIXrUbgeZVJAhetRuB7FUkDNzMzMzHxTQArXo3A9ulFAcT0K16PgUEDhehSuRwFRQB+F61G4flBASOF6FK6XUECamZmZmclQQHE9Ctej0FBA7FG4HoVbUUBxPQrXo0BSQFK4HoXrMVJAw/UoXI9iUkBcj8L1KFxSQOF6FK5HMVJAKVyPwvXYUUAAAAAAAIBRQHsUrkfhulFAj8L1KFx/UUB7FK5H4RpRQEjhehSuF1FAAAAAAAAQUUA9CtejcE1RQMP1KFyPQlFA16NwPQrnUEDsUbgehXtQQB+F61G43k5AH4XrUbgeTUCkcD0K18NLQKRwPQrXo0pA9ihcj8JVSkApXI/C9ehJQM3MzMzM7EpAuB6F61FYSkB7FK5H4dpKQEjhehSuh0lACtejcD3qSUA9CtejcB1KQPYoXI/C1UlASOF6FK4nSkAzMzMzM1NKQFK4HoXrUUpAFK5H4Xr0SUA9CtejcH1JQHE9CtejEEpAFK5H4XpUSkBmZmZmZoZKQK5H4XoULkpAZmZmZmamSkCkcD0K10NLQArXo3A9aktAXI/C9SicS0Bcj8L1KFxLQJqZmZmZWUtASOF6FK4HS0DhehSuRwFLQAAAAAAA4EpAAAAAAAAAS0BxPQrXo/BKQD0K16NwvUpAj8L1KFxPSkBmZmZmZoZKQIXrUbgeBUtA9ihcj8LVSkAzMzMzM9NJQClcj8L1yElAzczMzMwsSkBxPQrXo7BKQOxRuB6Fy0pA7FG4HoVrSkApXI/C9chKQM3MzMzMzEpAexSuR+E6S0CamZmZmTlLQIXrUbgeZUpAXI/
